import Logo from "../../assets/img.png";
import { ThemeDiv, ThemeHeader } from "./style";
const HeaderHome = () => {
  return (
    <ThemeHeader w="100%">
      <img src={Logo} alt="Logo" />
      <ThemeDiv f="row">
        <ul>
          <li>
            <button>Home</button>
          </li>
          <li>
            <button>Login</button>
          </li>
          <li>
            <button>Cadastrar escola</button>
          </li>
          <li>
            <button>Eventos</button>
          </li>
        </ul>
      </ThemeDiv>
    </ThemeHeader>
  );
};

export default HeaderHome;
